create view itrainingmodel(id, trainingmodel_task_id, optimizer_name, learning_rate, num_epochs) as
select ds.id, ds.trainingmodel_task_id, ds.optimizer_name, ds.learning_rate, ds.num_epochs
 from ds_itrainingmodel as ds
;
create view otrainingmodel(id, trainingmodel_task_id, adaptation_task_id, timestamp, elapsed_time, loss, accuracy, val_loss, val_accuracy, epoch) as
select ds.id, ds.trainingmodel_task_id, ds.adaptation_task_id, ds.timestamp, ds.elapsed_time, ds.loss, ds.accuracy, ds.val_loss, ds.val_accuracy, ds.epoch
 from ds_otrainingmodel as ds
;
create view oadaptation(id, adaptation_task_id, new_lrate, timestamp, epoch_id, adaptation_id) as
select ds.id, ds.adaptation_task_id, ds.new_lrate, ds.timestamp, ds.epoch_id, ds.adaptation_id
 from ds_oadaptation as ds
;
